import React from "react";
import { FaBeer } from 'react-icons/fa';

function Footer() {
  return (
    <footer>
      <hr />
      <p className="pull-right">
        <i className="fab fa-github" /> React Google Books Search
      </p>
      <h3> Lets go for a <FaBeer />? </h3>
    </footer>
  );
}

export default Footer;
